import React, { useEffect, useState } from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

function ProductComponant() {

    const [products, setproducts] = useState([])

    useEffect(() => {
        fetch("https://fakestoreapi.com/products").then(data => data.json()).then(data => setproducts(data))
    }, [])

    console.log('XKXAS', products)

    return (
        <div>
            <h2>Productss</h2>
            <div className="row">
                {products && products?.map((data) => (
                        <div className='col-md-4' >
                        <Card style={{ width: '18rem' }}>
                            <Card.Img variant="top" style={{width:'100%',height:'130px'}} src={data?.image} />
                            <Card.Body>
                                <Card.Title>Card Title</Card.Title>
                                <Card.Text>
                                    Some quick example text to build on the card title and make up the
                                    bulk of the card's content.
                                </Card.Text>
                                <Button  style={{width:'100',height:'40px'}} variant="primary">Go somewhere</Button>
                            </Card.Body>
                        </Card>
                        </div>

            ))}
            </div>
        </div>
    )
}

export default ProductComponant
